This NEXPack "Apex" (Style: RC142) rifle soft case carries two rifles with velcroe stays and has pack straps on the back.   Actual dimensions are: 43" x 14" x 4.5"; 

 I bought it for my AR10T, but the barrel sticks out 2 inches (24" barrel).  A 42 inch long gun should fit in this package nicely.  It was my intent to house my AR and a tactical shotgun in it for 3 gun, but it just doesn't fit my heavy metal.   

It retails for 110.99, I will let it go for $70.00.  A couple more  pic's if your interested.
